last nite i was invited to a special screening of the docuseries, “lorena” from executive producer @jordanpeele. 
set to air on february 15th, the 4 part series will delve into the notorious case of husband and wife john and lorena bobbitt.
the series will surely shed more awareness on domestic violence.

