text:
standing in front of you dropping the knowledge you never knew you needed.... yeah- that’s my jam! 
@aflvofficial happened this past weekend and it was full of great times, educational sessions , and making memories with first place in the stroll competition, all with @fcflspeakers and @unccgogreek ♥️ i am blessed to travel the country and talk to men and women about sexual assault, building community, and women’s empowerment. then i get to have a great time in my day to day job with the best students this side of the mississippi! 
i’m really blessed to do what i do! i love what i do. and i can’t wait to get to do it more and more this semester!

